import { render } from '@testing-library/react';
import React, { Component } from 'react'
import { Row, Col, Table, Button, FormControl, FormGroup } from "react-bootstrap"
import './Registration.css'

var newPatient = {
    firstName: '',
    lastName: '',
    npi: 0,
    phoneNumber: '',
    email: '',
    streetAddress: '',
    city: '',
    state: '',
    zip: 0
}

export class Registration extends Component {
    constructor (props) {
        super(props);
        this.state = {
            patients: [
                {
                    FirstName: 'John',
                    LastName: 'Doe',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    Address: {
                        Line1: '248 Spruce Street',
                        Line2: '#452',
                        City: 'Baltimoreland',
                        State: 'Maryland',
                        ZipCode: 32194
                    }
                },
                {
                    FirstName: 'Jamie',
                    LastName: 'Friend',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    Address: {
                        Line1: '248 Spruce Street',
                        Line2: '#452',
                        City: 'Baltimoreland',
                        State: 'Maryland',
                        ZipCode: 32194
                    }
                }
            ]
        }
    }

    headers() {
        return this.state.columns.map(col => {
            <th>{ col }</th>
        });
    }

    renderPatient (patient, index) {
        return (
            <tr key={index}>
                <td>{ patient.FirstName }</td>
                <td>{ patient.LastName }</td>
                <td>{ patient.NPI }</td>
                <td>{ patient.PhoneNumber }</td>
                <td>
                    { patient.Address.Line1 } <br />
                    { patient.Address.Line2 } <br />
                    { patient.Address.City } <br />
                    { patient.Address.State } <br />
                    { patient.Address.ZipCode }
                </td>
            </tr>
        )
    }


    onFormChange (input, field) {
        console.log(input);
        console.log(field);
        switch (field) {
            case 'firstName': {
                newPatient.firstName = input;
                break;
            }

            case 'lastName': {
                newPatient.lastName = input;
                break;
            }

            case 'npi': {
                newPatient.npi = input;
                break;
            }

            case 'phone': {
                newPatient.phoneNumber = input;
                break;
            }

            case 'email': {
                newPatient.email = input;
                break;
            }

            case 'streetAddress': {
                newPatient.phoneNumber = input;
                break;
            }

            case 'city': {
                newPatient.city = input;
                break;
            }

            case 'state': {
                newPatient.state = input;
                break;
            }

            case 'zip': {
                newPatient.zip = input;
                break;
            }
        }

    }

    handleSubmit (event) {
        console.log(newPatient);
       console.log(event);
    }

    render () {
        return (
            <div>
                <form onSubmit={this.handleSubmit} className="reg-form" >
                    <h1>Availity Patient Registration</h1>
                    <Row className='mb-3'>
                        <FormGroup as={Col} md='4' controlId='validationFormik01'>
                                <FormControl 
                                    className='form-input'
                                    type="text"
                                    name='firstName'
                                    placeholder="Enter First Name"
                                    value={newPatient.firstName}
                                    onChange={e => this.onFormChange(e.target.value, 'firstName')}
                                />
                        </FormGroup>
                        <FormGroup as={Col} md='4' controlId='validationFormik02'>
                                <FormControl 
                                    className='form-input'
                                    type="text"
                                    name='lastName'
                                    placeholder="Enter Last Name" 
                                    value={newPatient.lastName}
                                    onChange={e => this.onFormChange(e.target.value, 'lastName')}
                                />
                        </FormGroup>
                        <FormGroup as={Col} md='4' controlId='validationFormik03'>
                                <FormControl 
                                    className='form-input'
                                    type="text"
                                    name='npi'
                                    placeholder="Enter NPI #" 
                                    value={newPatient.npi}
                                    onChange={e => this.onFormChange(e.target.value, 'npi')}
                                />
                        </FormGroup>
                    </Row>
                    <Row className='mb-3'>
                        <FormGroup as={Col} md='6' controlId='validationFormik04'>
                                <FormControl 
                                        className='form-input'
                                        type="text"
                                        name='phoneNumber'
                                        placeholder="Enter Phone #" 
                                        value={newPatient.phoneNumber}
                                        onChange={e => this.onFormChange(e.target.value, 'phone')}
                                    />
                        </FormGroup>
                        <FormGroup as={Col} md='6' controlId='validationFormik05'>
                                <FormControl 
                                    className='form-input'
                                    type="text"
                                    name='emailAddress'
                                    placeholder="Enter Email Address"
                                    value={newPatient.email}
                                    onChange={e => this.onFormChange(e.target.value, 'email')}
                                />
                        </FormGroup>
                    </Row>
                    <Row className='mb-3'>
                        <FormGroup as={Col} md='3' controlId='validationFormik06'>
                            <FormControl 
                                className='form-input'
                                type="text"
                                name='streetAddress'
                                placeholder="Enter Street Address" 
                                value={newPatient.streetAddress}
                                onChange={e => this.onFormChange(e.target.value, 'streetAddress')}
                            />
                        </FormGroup>
                        <FormGroup as={Col} md='3' controlId='validationFormik07'>
                            <FormControl 
                                className='form-input'
                                type="text"
                                name='city'
                                placeholder="Enter City" 
                                value={newPatient.city}
                                onChange={e => this.onFormChange(e.target.value, 'city')}
                            />
                        </FormGroup>
                        <FormGroup as={Col} md='3' controlId='validationFormik08'>
                            <FormControl 
                                className='form-input'
                                type="text"
                                name='state'
                                placeholder="Enter State"
                                value={newPatient.state}
                                onChange={e => this.onFormChange(e.target.value, 'state')}
                            />
                        </FormGroup>
                        <FormGroup as={Col} md='3' controlId='validationFormik09'>
                            <FormControl 
                                className='form-input'
                                type="text"
                                name='zipCode'
                                placeholder="Enter Zip"
                                value={newPatient.zip}
                                onChange={e => this.onFormChange(e.target.value, 'zip')}
                            />
                        </FormGroup>
                    </Row>
                    <Button type='submit'>Submit</Button>
                </form>
                <Table striped bordered hover size='sm' className='patients-tbl'>
                    <thead>
                        <tr>
                            <th>First Name</th>
                            <th>Last Name</th>
                            <th>NPI #</th>
                            <th>Phone Number</th>
                            <th>Business Address</th>
                        </tr>
                    </thead>
                    <tbody>
                        {this.state.patients.map(this.renderPatient)}
                    </tbody>
                </Table>
            </div>
        )
    }
}
